(69, '1021', 27, '	/**\n	 * %commentリストをDBから取得する\n	 */\n	public function get%field_cList(){\n		if(empty($this->%field_out_model_c)){\n			App::uses(\'%field_out_model_c\',\'Model\');\n			$this->%field_out_model_c=ClassRegistry::init(\'%field_out_model_c\');\n		}\n		$fields=array(\'id\',\'%field_out_model_s_name\');//SELECT情報\n		$conditions=array(\"delete_flg = 0\");//WHERE情報\n		$order=array(\'sort_no\');//ORDER情報\n		$option=array(\n				\'fields\'=>$fields,\n				\'conditions\'=>$conditions,\n				\'order\'=>$order,\n		);\n\n		$data=$this->%field_out_model_c->find(\'all\',$option); // DBから取得\n		\n		// 構造変換\n		if(!empty($data)){\n			$data = Hash::combine($data, \'{n}.%field_out_model_c.id\',\'{n}.%field_out_model_c.%field_out_model_s_name\');\n		}\n		\n		return $data;\n	}', 77, 0, 'kani', '::1', '2018-04-23 16:41:22', '2018-09-02 13:46:45'),
