(440, '4034', 27, '	\n	/**\n	 * %commentリストを取得する\n	 */\n	public function get%field_out_model_cList(){\n		$%field_out_model_lccList = [];\n		$data = DB::table(\'%field_out_model_ss\')->select(\'id\', \'name\')->whereRaw(\"(deleted_at IS NULL OR deleted_at = 0 OR deleted_at = \'\')\")->get();\n		\n		foreach($data as $ent){\n			$%field_out_model_lccList[$ent->id] = $ent->name;\n		}\n		\n		return $%field_out_model_lccList;\n	}', 236, 0, 'kani', '::1', '2023-01-06 14:51:45', '2023-01-06 07:31:51'),
(441, '4034', 31, '	\n	/**\n	 * %commentリストを取得する\n	 * @return [] %commentリスト\n	 */\n	public function get%field_out_model_cList(){\n		return [        \n				1 => \'ダミー1\',\n				2 => \'ダミー2\',\n				3 => \'ダミー3\', \n		];\n	}', 236, 0, 'kani', '::1', '2023-01-06 15:09:09', '2023-01-06 06:19:25');
